<!doctype html>
<html lang="en-us">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
    <title>AltairEgo BASIC</title>
    <link href="https://fonts.googleapis.com/css2?family=VT323&display=swap" rel="stylesheet">
    <style>
      body {
        font-family: 'VT323', monospace;
        background-color: #d2b48c; /* Tan color, like old plastic */
        color: #33ff33; /* Bright green text */
        margin: 0;
        padding: 20px;
        display: flex;
        justify-content: center;
        align-items: center;
        min-height: 100vh;
        box-sizing: border-box;
      }
      .terminal {
        background-color: #2c2c2c; /* Dark gray */
        border: 20px solid #8c7b6c; /* Darker tan */
        border-radius: 10px;
        box-shadow: 0 0 20px rgba(0,0,0,0.5), inset 0 0 10px rgba(0,0,0,0.5);
        padding: 20px;
        width: 80%;
        max-width: 800px;
        height: 80vh;
        display: flex;
        flex-direction: column;
      }
      .header {
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin-bottom: 10px;
        color: #f0f0f0;
      }
      .logo {
        cursor: pointer;
      }
      .logo.disabled {
        cursor: not-allowed;
        opacity: 0.5;
      }
      .logo svg {
        width: 50px;
        height: 50px;
        fill: #f0f0f0;
        transition: transform 0.2s, filter 0.2s;
      }
      .logo:hover svg {
        transform: scale(1.1);
        filter: brightness(1.2);
      }
      .logo.disabled:hover svg {
        transform: none;
        filter: none;
      }
      h1 {
        margin: 0;
        font-size: 2em;
        text-shadow: 0 0 5px #33ff33;
      }
      .github-link {
        color: #f0f0f0;
        text-decoration: none;
        font-size: 24px;
      }
      .github-link:hover {
        color: #33ff33;
      }
      .screen {
        background-color: #000;
        border: 2px solid #555;
        border-radius: 5px;
        flex: 1;
        overflow-y: scroll;
        padding: 10px;
        box-sizing: border-box;
        position: relative;
        box-shadow: inset 0 0 10px rgba(0,0,0,0.8);
        margin-bottom: 10px;
      }
      .screen::before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        background: linear-gradient(rgba(18, 16, 16, 0) 50%, rgba(0, 0, 0, 0.25) 50%), linear-gradient(90deg, rgba(255, 0, 0, 0.06), rgba(0, 255, 0, 0.02), rgba(0, 0, 255, 0.06));
        z-index: 2;
        background-size: 100% 4px, 3px 100%;
        pointer-events: none;
      }
      #output {
        width: 100%;
        color: #33ff33;
        white-space: pre-wrap;
        word-wrap: break-word;
      }
      #input-container {
        display: flex;
        margin-top: 15px;
      }
      #input-prompt {
        color: #33ff33;
        margin-right: 5px;
      }
      #input {
        flex: 1;
        background-color: transparent;
        border: none;
        color: #33ff33;
        font-family: 'VT323', monospace;
        font-size: 1em;
        outline: none;
      }
    </style>
  </head>

<script type="text/javascript">
    var resolveInputPromise;

    function createInputPromise() {
        window.awaitInputPromise = new Promise((resolve) => {
            resolveInputPromise = resolve;
        });
    }

    function scrollToBottom() {
        let screen = document.querySelector('.screen');
        if (screen) {
            setTimeout(() => {
                screen.scrollTop = screen.scrollHeight;
            }, 0);
        }
    }

    window.isAwaitingInput = false;
    createInputPromise();

    var Module = {
        preRun: [],
        postRun: [],
        print: (() => {
            var element = document.getElementById('output');
            if (element) element.innerHTML = ''; // clear browser cache
            return function(text) {
                if (arguments.length > 1) text = Array.prototype.slice.call(arguments).join(' ');
                console.log(text);
                if (element) {
                    element.innerHTML += text + "\n";
                    scrollToBottom();
                }
            };
        })(),
        printErr: function(text) {
            if (arguments.length > 1) text = Array.prototype.slice.call(arguments).join(' ');
            console.error(text);
        },
        setStatus: function(text) {},
        totalDependencies: 0,
        monitorRunDependencies: function(left) {
            this.totalDependencies = Math.max(this.totalDependencies, left);
            Module.setStatus(left ? 'Preparing... (' + (this.totalDependencies - left) + '/' + this.totalDependencies + ')' : 'All downloads complete.');
        },
        onRuntimeInitialized: async function() {
            let output = document.getElementById('output');
            let input = document.getElementById('input');
            let fileInput = document.getElementById('file-input');
            let logo = document.getElementById('logo');

            let process_line = Module.cwrap('process_line', 'string', ['string'], {
                async: true
            });
            let get_input_buffer = Module.cwrap('get_input_buffer', 'number', []);
            let input_buffer_ptr = get_input_buffer();

            let initial_output = await process_line("");
            output.innerHTML += initial_output;
            scrollToBottom();

            logo.addEventListener('click', () => {
                if (logo.classList.contains('disabled')) {
                    return;
                }
                fileInput.click();
            });

            fileInput.addEventListener('change', (event) => {
                const file = event.target.files[0];
                if (file) {
                    logo.classList.add('disabled');
                    const reader = new FileReader();
                    reader.onload = async (e) => {
                        await process_line("NEW");
                        output.innerHTML = "";
                        const program = e.target.result;
                        const lines = program.split('\n');
                        for(const line of lines) {
                            if (line.trim()) {
                                output.innerHTML += `> ${line}\n`;
                                await process_line(line);
                            }
                        };
                        scrollToBottom();
                        logo.classList.remove('disabled');
                    };
                    reader.readAsText(file);
                }
                event.target.value = '';
            });

            input.addEventListener('keydown', async (e) => {
                if (e.key === 'Enter') {
                    let command = input.value;
                    let upperCommand = command.toUpperCase().trim();
                    input.value = '';

                    let command_display = `>${command}\n`;
                    let current_output = output.innerHTML;
                    if (current_output.endsWith('\n')) {
                        output.innerHTML = current_output + command_display;
                    } else {
                        output.innerHTML = current_output + "\n" + command_display;
                    }
                    scrollToBottom();

                    if (window.isAwaitingInput) {
                        Module.stringToUTF8(command, input_buffer_ptr, 256);
                        resolveInputPromise();
                        createInputPromise();
                    } else {
                        if (upperCommand === 'RUN') {
                            logo.classList.add('disabled');
                        }
                        let result = await process_line(command);
                        if (result) {
                            output.innerHTML += result;
                        }
                        if (upperCommand === 'RUN') {
                            logo.classList.remove('disabled');
                        }
                    }
                }
            });
        }
    };
    Module.setStatus('Downloading...');
</script>

function getBinaryPromise() {

  // Cordova or Electron apps are typically loaded from a file:// url.

  if (!wasmBinary && (ENVIRONMENT_IS_WEB || ENVIRONMENT_IS_WORKER)) {

  return Promise.resolve().then(function() { return getBinary(wasmBinaryFile); });

  preRun();

  // a preRun added a dependency, run will be called later
  if (runDependencies > 0) {
    return;
  }

function checkUnflushedContent() {

  // the streams is not possible. but in ASSERTIONS mode we check
  // if there was something to flush, and if so tell the user they
  // should request that the runtime be exitable.

  // the code is inside libc)
  var oldOut = out;
  var oldErr = err;

  out = err = (x) => {
    has = true;

    ___stdio_exit();
